@pytest.mark.parametrize(
    "codigoVerificacion", 
    [
        ("8971b344-e3fd-4a9c-8fe5-7dde64c8808c"),
        ("821c4d2c-7ee6-4f64-850f-b3bb3fe7d493"),
        ("00196dec-f7fc-448b-afb5-a0bc1553d74b")
    ]
)
def test_postVerify(codigoVerificacion):
    response = postVerify([
        {
            "firma": codigoVerificacion,
            "fileUp": "",
            "urlFileUp": ""
        }
    ])
    assert response.status_code == 200

def test_falloPostVerify():
    response = postVerify([
        {
            "firma": "",
            "fileUp": "",
            "urlFileUp": ""
        }
    ])
    assert response.status_code == 400